import styled from 'styled-components';

const Form = styled.form`
  width: 300px;
  margin: 0 auto;
`;

const Input = styled.input`
  padding: 8px;
  margin: 8px 0;
  border: 1px solid #ccc;
`;

const Button = styled.button`
  background-color: #007bff;
  color: #fff;
  padding: 10px 20px;
  border: none;
`;
